#What is the length of the shortest polymer you can produce
#by removing all units of exactly one type and fully reacting the result?

import sys

def react(s):
  temp_s = s
  prev_s = s
  done = False
  while not done:
    for c in "abcdefghijklmnopqrstuvwxyz":
      c_cap = c.upper()
      temp_s = temp_s.replace(c+c_cap,'').replace(c_cap+c,'')
    if (len(prev_s) == len(temp_s)):
      done = True
    else:
      prev_s = temp_s
        
  return(temp_s)

def canReact(s):
  return ( ((s[0:1].islower() and s[1:].isupper()) or
    (s[0:1].isupper() and s[1:].islower())) and
    (s[0:1].lower() == s[1:].lower()) )

s = ""

keep_c = ''
#smallest = sys.maxsize #int
smallest = sys.maxsize+1 # long
for c in "abcdefghijklmnopqrstuvwxyz":
  temp_s = s.replace(c,'').replace(c.upper(),'')
  if len(react(temp_s)) < smallest:
    keep_c = c
    smallest = len(react(temp_s))
    
print(keep_c + ": " + str(smallest) )

print("done.")

